	add("absceso", "{\"term\":\"absceso\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Esperanto\", \"French\"], \"text\":\"From French \u0027abcès\u0027 English \u0027abscess\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"abscess\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abscess", "{\"term\":\"abscess\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027abscessus\u0027 (a going away; gathering of humors, abscess) from {{m|la|abscēdō||go away, depart}}, from \u0027abs\u0027 (away from) + {{m|la|cēdō||go}}. See \u0027cede\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cavity caused by tissue destruction, usually because of infection, filled with pus and surrounded by inflamed tissue. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abscissa", "{\"term\":\"abscissa\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027abscissa\u0027 feminine of \u0027abscissus\u0027 perfect passive participle of {{m|la|abscindō||cut off}}. See \u0027abscind\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The first of the two terms by which a point is referred to, in a system of fixed rectilinear coordinate (Cartesian coordinate) axes. The abscissa is also known as the \u0026quot;x\u0026quot; coordinate of a point, shown on the horizontal line, with the ordinate, also known as the \u0026quot;y\u0026quot; coordinate, shown on the vertical line. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The point \u0026lt;math\u0026gt;(3,2)\u0026lt;/math\u0026gt; has 3 as its \u0027\u0027abscissa\u0027\u0027 and 2 as its ordinate\", \"priority\":2}]}, \"synonyms\":{}}");

