	add("abscissin", "{\"term\":\"abscissin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|abscission|in|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plant hormone controlling the dropping off or abscission of certain plant parts, notably the leaves of trees in autumn or cotton bolls\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abscission", "{\"term\":\"abscission\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|abscissiō}}, from {{m|la|abscindō||I cut, I tear}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of cutting off\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1859\u0027\u0027, w:Jeremy Jeremy Taylor, \u0027The sermons of the Right Rev. Jeremy Taylor: Complete in one volume\u0027, page 286\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Not to be cured without the \u0027\u0027abscission\u0027\u0027 of a member\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The state of being cut off\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A figure of speech employed when a speaker having begun to say a thing stops abruptl\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The natural separation of a part at a predetermined location, such as a leaf at the base of the petiole\", \"priority\":6}]}, \"synonyms\":{}}");

