	add("absentation", "{\"term\":\"absentation\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\"], \"text\":\"From \u0027absentatio\u0027 () from \u0027absento\u0027 (to be absent) Equivalent to {{suffix|absent|ation|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of absenting oneself. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

