	add("absolute", "{\"term\":\"absolute\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which is totally unconditioned, unrestricted, pure, perfect, or complete; that which can be thought of without relation to others. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("absoluteness", "{\"term\":\"absoluteness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|absolute|ness|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fact of being finished or perfected; completeness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The characteristic of being absolute in nature or scope\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027absoluteness\u0027\u0027 of his sovereignty,\u0026amp;emsp; the \u0027\u0027absoluteness\u0027\u0027 of his convictions\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Absolute authority, unlimited power; absolutism, despotism\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I know no man that could produce more parts, both naturall and artificiall, fit to preserve his masterie, and to maintaine his \u0027\u0027absolutenesse\u0027\u0027, than he doth; yet is hee cleane falne from them like a childe\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The fact of being without qualifications or conditions; certainty, unconditionality\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Independent autonomy\", \"priority\":7}]}, \"synonyms\":{}}");

	add("absolutism", "{\"term\":\"absolutism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"First attested in 1753 (in the theological sense); attested in 1830 in the political sense. From {{suffix|absolute|ism|lang\u003den}} after French \u0027absolutisme\u0027 \u0026lt;ref name\u003dSOED\u0026gt;{{R:SOED5|page\u003d9}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Doctrine of preordination; doctrine of absolute decrees; doctrine that God acts in an absolute manner. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The principles or practice of absolute or arbitrary government; despotism. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The element of \u0027absolutism\u0027 and prelacy was controlling. - Palfre\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Belief in a metaphysical absolute; belief in Absolute. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Positiveness; the state of being absolute\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The characteristic of being absolute in nature or scope; absoluteness\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Ruth R. Wisse, \u0027The Modern Jewish Canon: A Journey Through Language\u0027 (ISBN 0226903184\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"It was the \u0027\u0027absolutism\u0027\u0027 of his ambition to be a perfect writer (and perhaps also the perfect son) that imperiled him\", \"priority\":8}]}, \"synonyms\":{}}");

	add("absolutist", "{\"term\":\"absolutist\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From {{suffix|absolute|ist|lang\u003den}} after French \u0027absolutiste\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who is in favor of an absolute or autocratic government. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who believes that it is possible to realize a cognition or concept of the Absolute. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An uncompromising person; one who maintains certain principles to be absolute. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":3}]}, \"synonyms\":{}}");

