	add("absorbance", "{\"term\":\"absorbance\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|absorb|ance|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A logarithmic measure of the amount of light that is absorbed when passing through a substance; the capacity of a substance to absorb light of a given wavelength; optical density. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

