	add("absorptance", "{\"term\":\"absorptance\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Circa 20th century, from {{suffix|absorption|ance|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Absorbed radiation and incident radiation in a ratio format; a measurement that shows how well a surface absorbs radiation. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("absorptiometer", "{\"term\":\"absorptiometer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|absorption|meter|t1\u003dabsorption|t2\u003dmeasure|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A instrument that computes the absorption rate by measuring the pressure of the gas; a colorimeter for liquids. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An instrument used to measure the amount of radiation or light absorbed. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":2}]}, \"synonyms\":{}}");

	add("absorptiveness", "{\"term\":\"absorptiveness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|absorptive|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being absorptive; absorptive power\", \"priority\":1}]}, \"synonyms\":{}}");

	add("absorptivity", "{\"term\":\"absorptivity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|absorptive|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being absorptive; absorptiveness. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The fraction of radiation absorbed by a surface to the total radiation incident on the surface. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The constant a in the Beer\u0027s law relation A \u003d abc, where A is the absorbance, b the path length, and c the concentration of solution. Also known as absorptive power. Formerly known as absorbency index; absorption constant; extinction coefficient\", \"priority\":3}]}, \"synonyms\":{}}");

