	add("abstainer", "{\"term\":\"abstainer\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027absteiner\u0027 from \u0027absteinen\u0027 (to abstain)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"agent Agent noun of abstain; one who abstains; especially, one who abstains from something they enjoy, such as the use of intoxicating liquors, or one who abstains for religious reasons; one who practices self-denial. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abstemiousness", "{\"term\":\"abstemiousness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|abstemious|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being abstemious, temperate, or sparing, particularly in the use of food and strong drinks. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abstention", "{\"term\":\"abstention\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"First attested in 1521. From French \u0027abstention\u0027 from {{m|la|abstēntiō}} from Latin {{m|la|abstinēō||withhold, to abstain}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of restraining oneself. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of abstaining; a holding aloof; refraining from. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of declining to vote on a particular issue. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Non-participation in the political world; as a country avoiding international affairs\", \"priority\":4}]}, \"synonyms\":{}}");

	add("abstentionism", "{\"term\":\"abstentionism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027abstentionnisme\u0027 Equivalent to {{suffix|abstention|ism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A policy of abstaining or of the desirability of withholding one\u0027s vote or other participation with regard to some aspect of the political process. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Abstentionism\u0027\u0027 is a manifestation of political independence\", \"priority\":2}]}, \"synonyms\":{}}");

	add("abstentionist", "{\"term\":\"abstentionist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|abstention|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A practitioner or advocate of not getting involved politically. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An \u0027\u0027abstentionist\u0027\u0027 only has influence through public opinion\", \"priority\":2}]}, \"synonyms\":{}}");

	add("abstersiveness", "{\"term\":\"abstersiveness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|abstersive|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being abstersive. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abstinence", "{\"term\":\"abstinence\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Old french (842-ca. 1400) \u0027abstinence\u0027 from Latin \u0027abstinentia\u0027 from \u0027abstinēns\u0027 present participle of {{m|la|abstinēō||I withhold}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or practice of abstaining, refraining from indulging a desire or appetite. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Penance, fasts, and \u0027\u0027abstinence\u0027\u0027, / To punish bodies for the soul\u0027s offense.\u0027 - w:John John Dryde\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027abstinence\u0027\u0027 from a present pleasure that offers itself is a pain, nay, oftentimes, a very great one.\u0027 — w:John John Lock\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Complete \u0027\u0027abstinence\u0027\u0027 is easier than perfect moderation.\u0027 — w:Augustine of St Augustin\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Specifically, the practice of abstaining from intoxicating/alcoholic beverages; total abstinence; teetotalism). \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Specifically, the practice of abstaining from sexual intercourse, either permanently or until marriage. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Abstention from certain foods on days of penitential observance. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The practice of self-denial; self-restraint; forebearance from anything. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Self-denial; abstaining; or forebearance of anything. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Delay of spending to accrue capital\", \"priority\":10}]}, \"synonyms\":{}}");

	add("abstinency", "{\"term\":\"abstinency\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|abstinence|y|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abstinent", "{\"term\":\"abstinent\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027abstinent\u0027 (adjective form).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of a sect who appeared in France and Spain in the 3rd century, and believed in abstinence towards meat and sex\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abstractedness", "{\"term\":\"abstractedness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|abstracted|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being abstracted; abstract character. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abstracter", "{\"term\":\"abstracter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|abstract|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who abstracts, or makes an abstract, as in records or documents. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Someone that finds and summarizes information for legal or insurance work\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An accounting clerk who records payroll deductions\", \"priority\":3}]}, \"synonyms\":{}}");

	add("abstraction", "{\"term\":\"abstraction\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"Either from Middle french (ca. 1400-1600) or from \u0027abstractio\u0027 (separation) from Latin {{m|la|abstrahō||to draw away}}. Equivalent to {{suffix|abstract|tion|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of abstracting, separating, withdrawing, or taking away; withdrawal; the state of being taken away. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1848\u0027\u0027, w:John Stuart J. S. Mill, \u0027Principles of Political Economy with some of their Applications to Social Philosophy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The cancelling of the debt would be no destruction of wealth, but a transfer of it: a wrongful \u0027\u0027abstraction\u0027\u0027 of wealth from certain members of the community, for the profit of the government, or of the tax-payers\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The taking surreptitiously for one\u0027s own use part of the property of another; purloining. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Removal of water from a river, lake, or aquifer\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A separation from worldly objects; a recluse life, as \u0027a hermit\u0027s \u0027\u0027abstraction\u0027\u0027\u0027; the withdrawal from one\u0027s senses. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The act of focusing on one characteristic of an object rather than the object as a whole group of characteristics; the act of separating said qualities from the object or ideas. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"W. Hamilton, in \u0027Lectures on Metaphysics and Logic\u0027 (1860), Lecture XXXV, [http://books.google.com/books?id\u003dVuQQAAAAYAAJ\u0026amp;pg\u003dPA474\u0026amp;dq\u003dAbstraction-is-no-positive-act\u0026amp;ei\u003dAMm4R_vkMY2kzgSI4MTEBQ page 474\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Abstraction\u0027\u0027 is no positive act: it is simply the negative of attention\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Abstraction\u0027\u0027 is necessary for the classification of things into genera and species\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The act of comparing commonality between distinct objects and organizing using those similarities; the act of generalizing characteristics; the product of said generalization. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"An idea or notion of an abstract or theoretical nature. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"to fight for mere \u0027\u0027abstractions\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Absence or absorption of mind; inattention to present objects; preoccupation. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"An abstract creation, or piece of art; qualities of artwork that are free from representational aspects. \u0026lt;ref name \u003d chambers\u0026gt;\u0026lt;/ref\u0026gt;\u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A separation of volatile parts by the act of distillation\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"An idea of an unrealistic or visionary nature\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The result of mentally abstracting an idea; the results of said process\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The merging of two river valleys by the larger of the two deepening and widening so much so, as to assimilate the smaller\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Any generalization technique that ignores or hides details to capture some kind of commonality between different instances for the purpose of controlling the intellectual complexity of engineered systems, particularly software systems\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Any intellectual construct produced through the technique of abstraction\", \"priority\":21}]}, \"synonyms\":{}}");

	add("abstractionism", "{\"term\":\"abstractionism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|abstraction|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The creation, principles, or ideals of abstractions, in particular art. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The presentation of ideas in an abstract manner. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":2}]}, \"synonyms\":{}}");

