	add("abstractness", "{\"term\":\"abstractness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|abstract|ness|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being abstract. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027abstractness\u0027\u0027 of the ideas. - w:John John Locke\", \"priority\":2}]}, \"synonyms\":{}}");

