	add("abstractum", "{\"term\":\"abstractum\", \"etymology\":{\"influencers\":[{}], \"languages\":[], \"text\":\"{{borrowing|la|abstractum|lang\u003den}} neuter of \u0027abstractus\u0027 (drawn away)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something which is abstract or exists abstractly. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abstriction", "{\"term\":\"abstriction\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027ab-\u0027 (from, away, outside) + \u0027strictio\u0027 (act of pressing together) from Latin \u0027strictus\u0027 (tightened) \u0026lt;ref name\u003dWI3\u0026gt;{{R:MW3 1976|page\u003d8}}\u0026lt;/ref\u0026gt; Equivalent to {{suffix|abstrict|ion|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A method of spore formation in fungi in which successive portions of the sporophore are cut off through the growth of septa; abjunction\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abstruseness", "{\"term\":\"abstruseness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|abstruse|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The property of being abstruse; abstrusity. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abstrusity", "{\"term\":\"abstrusity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|abstruse|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Abstruseness; that which is abstruse. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("absurdism", "{\"term\":\"absurdism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{wikipedia}}{{suffix|absurd|ism|t2\u003ddoctrine, theory|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A philosophy which holds that the universe is chaotic and irrational and that any attempt to impose order will ultimately fail. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Absurdity, something that is absur\", \"priority\":2}]}, \"synonyms\":{}}");

	add("absurdist", "{\"term\":\"absurdist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|absurd|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An advocate of absurdism, in particular a writer of absurd topics. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("absurdity", "{\"term\":\"absurdity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"First attested around 1472. From Middle english (1100-1500) \u0027absurdite\u0027 \u0026lt;ref name\u003dRHD\u0026gt;{{R:RHCD|page\u003d7}}\u0026lt;/ref\u0026gt; then from \u0027\u0027either\u0027\u0027 Middle french (ca. 1400-1600) \u0027absurdité\u0027 \u0027\u0027or\u0027\u0027 from \u0027absurditas\u0027 (dissonance, incongruity) from Latin \u0027absurdus\u0027 {{suffix||itas|gloss2\u003dquality, state, degree|lang\u003dla|nocat\u003d1}}.\u0026lt;ref name\u003dWI3\u0026gt;{{R:MW3 1976|page\u003d8}}\u0026lt;/ref\u0026gt;\u0026lt;ref name\u003dSOED\u0026gt;{{R:SOED5|page\u003d10}}\u0026lt;/ref\u0026gt; Equivalent to {{suffix|absurd|ity|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Dissonance. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That which is absurd; an absurd action; a logical contradiction. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"His travels were full of \u0027\u0027absurdities\u0027\u0027. - Johnso\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\" The quality of being absurd or inconsistent with obvious truth, reason, or sound judgment. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027absurdity\u0027\u0027 of the actual idea of an infinite number. - w:John John Lock\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Neither [Jones] nor I (in 1966) could conceive of reducing our \u0026quot;science\u0026quot; to the ultimate \u0027\u0027absurdity\u0027\u0027 of reading Finnish newspapers almost a century and a half old in order to establish \u0026quot;priority.\u0026quot\", \"priority\":6}]}, \"synonyms\":{}}");

	add("absurdness", "{\"term\":\"absurdness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|absurd|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being absurd; absurdity. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("absurdum", "{\"term\":\"absurdum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{borrowing|la|absurdum|lang\u003den}}, neuter singular of Latin \u0027absurdus\u0027 (discordant, harsh) \u0026lt;ref name\u003dSOED\u0026gt;{{R:SOED5|page\u003d10}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An illogical conclusion or state. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

